        <Link href="/about">
            <a className='about'>About</a>
        </Link>
        <style jsx>{`
        a{
            color: black;
            text-decoration: none;
            padding: 10px 20px;
            display: inline-block;
            background: darkcyan;
            margin-right: 10px
            border: 1px solid gray;
        }
        `}

        </style>
</div>
);
export default Nav;
